A nice day at the home crag 😙 Surprise-sent Call Me Daddy (5.14a) after telling myself to not be such a weenie on the lower slab section (mostly just wanted to say the word ‘weenie’ out loud). Really did not expect to pull through, considering first lap of the day was painful on my fingers and linking bottom-to-top still felt so far away. But for the second lap I just focused on climbing the bottom precisely, thinking I would fall in the middle anyways. Turns out if you climb well, you can climb a little farther… and a little farther… and the rests get better… and then you’re like “it would suck to have to climb all that again, let’s try to keep it together” and then you’re @ the 🔝 !! 

Psyched psyched on this sport groove. Thanks to T for the catches and @vasyav87 for the link-up vision 🙏🏼🙏🏼 also what’s up with my LEGS in the first pic lol. #looong

