Found some sun in Hueco ☀️ A quick weekend yielded new-for-me Tequila Sunrise, redemption send on Choir Boys Low (heartbreaker dab 10 !! years ago), and osmosis stoke watching @tchenrock link some big overlaps on the Cave’s longest journey. I’m still in rope training mode but pretty glad I was goaded back to bouldering for a short bit. Biggest highlight was @mariaritavalles remembering me after all these years. Peep the waterpark postcard she signed for me nearly a decade ago! 😂🥹 Thanks @huecotanksstatepark, so many fond memories here 💛💛

Now back to routes, repeaters, and the windy River Wall 🌬️🥶

