Last Friday @alldayeddie and I biked from Boulder to Longs Peak trailhead, hiked to the base of the Diamond, simuled the Casual Route, topped out Longs, hiked back down, and rode our tired 🍑s back to Boulder: a self-timed endurance challenge known as the Longs Peak Triathlon. It was a full-value day, unsupported (meaning we carried all our gear), covering a little over 90 miles in a little under 17hrs. I am super proud of our efforts considering neither of us were cyclists before this spring season. That being said… I think we can go faster 😜 I know @alldayeddie is just raring to get back in the saddle!! 

With my newfound love for cycling, these multi-sport linkups have captured my imagination. Already scheming for next summer 🤔💭😇 

