Still wrapping my heart around @thenorthface Athlete Summit ❤️ We gathered to discuss expeditions, projects, products, and brand goals but the most important conversations happened in-between: around the campfire, on the beach, at the crag, next to the ping pong table, during a 3am ocean swim. The people on this team are absolute forces of inspiration and determination while also navigating all that it means to be a human being in this heavy world. And it is only getting heavier. 

I treasure these moments with a family of friends that I can turn to for both hard talks and easy laughter. Thanks for another year of love. #TNFAthleteSummit

